Given the following program and the specified variable, optimize it out by constant propagation or copy propagation. If this variable is unused, just optimize it out.. The program is 
struct c {
  int d : 18;
  int e;
  int f;
  int h;
};

struct c i;
struct c j;

int fn1() {
  struct c l = {24, 6738, 165};
  int m = j.e;
  l.d = m;
  int n = j.h && l.d;
  int o = l.d;
  int k = l.f;
  i.d = o | -(k && l.d) - n;
}

int main() {
  struct c k;
  k.d = 24;
  k.e = 6738;
  k.f = 165;
  k.h = 1;
  fn1();
  return 0;
}
.                 The target to be optimized is `e`.
